svg.script:
function showToolTip (evt, info)
{
    var target = get_target(evt);
    var svgdoc = target.getOwnerDocument();
    var svgdocElement = svgdoc.getDocumentElement();
    var scale = svgdocElement.getCurrentScale();
    var translateX = svgdocElement.getCurrentTranslate().getX();
    var translateY = svgdocElement.getCurrentTranslate().getY();
    var pixel = scale;
    var offsetX = parseFloat(0) - translateX * pixel;
    var offsetY = parseFloat(0) - translateY * pixel;
    var tooltip= 'Tooltip'
    var tooltiprect= 'TooltipRect'

    var svgobj = svgdoc.getElementById (tooltip);
    svgobj1 = svgobj.getFirstChild()
    var svgstyle = svgobj.getStyle();
    svgstyle.setProperty ('visibility', 'visible');
    svgstyle.setProperty('font-size', 12/scale);
    svgobj1.setData(info);
    var txtlen = svgobj.getComputedTextLength()+20/scale;

    var svgroot = svgdoc.getRootElement ();
    var svgwidth = svgroot.getAttribute ('width');
    var svgobj = svgdoc.getElementById (tooltip);
    var x = Math.round(offsetX + evt.getClientX()*pixel); 
    if ((offsetX + evt.getClientX()*pixel)-txtlen/2 < 0) x = txtlen/2*pixel;
    if ((offsetX + evt.getClientX()*pixel)+txtlen/2 > svgwidth) x = svgwidth - txtlen/2;
    svgobj.setAttribute ('x', x);
    svgobj.setAttribute ('y', Math.max(14/scale, Math.round(offsetY + evt.getClientY()*pixel - 18/scale)));

    var svgobj = svgdoc.getElementById (tooltiprect);
    var x = Math.max(0, (Math.round(offsetX + evt.getClientX()*pixel - txtlen/2))); 
    if (x+txtlen > svgwidth) x = svgwidth-txtlen;
    svgobj.setAttribute ('x', x); 
    svgobj.setAttribute ('y', Math.max(0, (Math.round(offsetY + evt.getClientY()*pixel - 32/scale))));
    svgobj.setAttribute ('width', txtlen);
    svgobj.setAttribute ('height', 20/scale);
    svgobj.setAttribute ('rx', 0/scale);
    svgobj.setAttribute ('ry', 0/scale);
    var svgstyle = svgobj.getStyle();
    svgstyle.setProperty ('visibility', 'visible');
}

function hideToolTip(evt)
{
    var target = get_target(evt);
    var svgdoc = target.getOwnerDocument();
    var tooltip= 'Tooltip'
    var tooltiprect= 'TooltipRect'
    var svgobj = svgdoc.getElementById (tooltip);
    var svgstyle = svgobj.getStyle();
    svgstyle.setProperty ('visibility', 'hidden');
    var svgobj = svgdoc.getElementById (tooltiprect);
    var svgstyle = svgobj.getStyle();
    svgstyle.setProperty ('visibility', 'hidden');
}

function get_target (evt)
{
    var target = evt.getTarget();
    while (target && !target.getAttribute('id'))
    target = target.getParentNode();
    return target;}
